/**
 * Grid Lookup Function (Global for other scripts)
 */
window.getStandardDensity = function(obsDensity, tempInput) {
    const rawTemp = parseFloat(tempInput);
    const targetDensity = Math.round(parseFloat(obsDensity));

    // Logic: Round the temperature to the nearest 0.5
    const targetTempKey = (Math.round(rawTemp * 2) / 2).toFixed(1);

    // Columns: Readings 700 to 900 (Offset 700)
    const colIndex = targetDensity - 700;
    const rowData = densityTable[targetTempKey];

    if (colIndex < 0 || colIndex > 200 || !rowData) {
        return "Range Error";
    }

    const val = rowData[colIndex];
    return (val === 0 || val === undefined) ? "Range Error" : val;
};

// --- HANDLER FOR DENSITY PAGE ---
document.getElementById('btnCalcDensity').onclick = () => {
    const obs = document.getElementById('obsDensity').value;
    const temp = document.getElementById('temp').value;
    const resDiv = document.getElementById('resDensity');

    if (!obs || !temp) return alert("Please fill in both fields");

    // 1. Show Loading State (Centered)
    resDiv.innerHTML = `
        <div style="display:flex; flex-direction:column; align-items:center; justify-content:center; padding:20px;">
            <div class="spinner"></div>
            <p style="color:#64748b; font-weight:600; margin-top:10px;">Connecting DB...</p>
        </div>`;

    setTimeout(() => {
        const result = window.getStandardDensity(obs, temp);

        if (result === "Range Error") {
            resDiv.innerHTML = `
                <div class="animate__animated animate__shakeX" style="color:#dc3545; text-align:center; padding:20px; font-weight:bold;">
                    OUT OF TABLE RANGE
                </div>`;
            return;
        }

        // 3. Centered Result in Light Blue Box
        resDiv.innerHTML = `
            <div class="animate__animated animate__fadeInUp">
                <div class="result-card">
                    <div class="checkmark-wrapper">
                        <svg class="checkmark" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 52 52">
                            <circle class="checkmark__circle" cx="26" cy="26" r="25" fill="none"/>
                            <path class="checkmark__check" fill="none" d="M14.1 27.2l7.1 7.2 16.7-16.8"/>
                        </svg>
                    </div>
                    <p>Standard Density @ 15C</p>
                    <div class="result-value">${result.toFixed(1)} <span style="font-size:16px;">kg/m</span></div>
                </div>
            </div>
        `;
    }, 800); 
};